import React from 'react';
import './work.css'
const Work = ({id,title})=>
    {
        return (
            <div className="work">
                <table>
                    <th>
                        <td>ID</td>
                        <td>Title</td>
                    </th>
                    <tr>
                        <td>{id}</td>
                        <td>{title}</td>
                    </tr>
                </table>
            </div>
        )
    }
export default Work;
